import React from 'react';

const HomePage = () => {
  return (
    <div className="home-page">
      <h2>Hoşgeldiniz</h2>
      <p>
        KriptoMentor platformuna hoşgeldiniz. Burada gerçek zamanlı sinyaller, piyasa verileri ve kripto haberlerini
        takip edebilirsiniz.
      </p>
    </div>
  );
};

export default HomePage;
